import "./SensorData.css";

function SensorData(props) {
  var unit = "";
  if (props.name === "Temperature") {
    unit = "celcius";
  } else if (props.name === "Heartrate") {
    unit = "bpm";
  } else if (props.name === "Humidity") {
    unit = "%";
  }
  return (
    <div className="box">
      <label className="title">{props.name}</label>
      <div className="valuebox">
        <label className="val">{props.data}</label>
        <label className="unit">{unit}</label>
      </div>
    </div>
  );
}

export default SensorData;
